import React, { Component } from 'react';
import ListItem from './ListItem';

class ListOfVideos extends Component {

    render(props) {
        const items = this.props.videos.map(video => 
            <ListItem 
                selected={this.props.selectVideo}
                key={video.etag}
                video={video}
            />
        )
        return (
            <ul>
                {items}
            </ul>
        )
    }
}

export default ListOfVideos;
